import {StyleSheet} from "react-native";

const styles = StyleSheet.create({
    container: {
        flex: 1,
        display: "flex",
        flexDirection: "row",
        height: 50,
        width: '100%',
        borderStyle: "solid",
        borderColor: "black"
    },

    nom: {
        alignItems: "center"
    }
})

export default styles;
